using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct SoundVolumeComponentResolver : IResolver<SoundVolumeComponent>, IResolver<SoundVolumeComponentResolver,SoundVolumeComponent>, IData	{		public SoundVolumeComponentResolver In(ref SoundVolumeComponent soundvolumecomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetSoundVolumeComponent();			Out(ref local);		}		public void Out(ref SoundVolumeComponent soundvolumecomponent)		{		}	}}